webpackJsonp([0xe474a5cc4dc1],{415:function(A,e){A.exports={data:{markdownRemark:{html:'<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 177.77777777777777%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Braintree Pride"\n        title=""\n        src="/static/braintreepride-8e18ba30038df7ee0529527688e8db9c-631b1.jpg"\n        srcset="/static/braintreepride-8e18ba30038df7ee0529527688e8db9c-30fbd.jpg 200w,\n/static/braintreepride-8e18ba30038df7ee0529527688e8db9c-e87dc.jpg 400w,\n/static/braintreepride-8e18ba30038df7ee0529527688e8db9c-631b1.jpg 800w,\n/static/braintreepride-8e18ba30038df7ee0529527688e8db9c-f04a1.jpg 1080w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>Pre Pride Parade selfie</h4>\n<p>So if you\'re paying attention, you know that I skipped last weeks blog post.</p>\n<p>I know, I know, I said that I would write every week, and here I am already breaking my promise.  But don\'t worry, I\'m back this week to catch you up, but I\'ve decided to break the update up into two posts to keep it digestible.</p>\n<p>Stay tuned for a bonus mid-week post this week with plenty of epic pictures from Tahoe.</p>\n<h2>Outside of work</h2>\n<p>It wasn\'t until I was recapping my week on the phone to my parents that I realized that I had been busy almost every single night after work.</p>\n<p>On Tuesday I attended the Inaugural <a href="https://hackernoon.com/">Hacker Noon</a> Party.</p>\n<p>This is part of the magic of San Francisco.  I saw the event advertised on a Hacker Noon article, and a few days later I walked a few blocks to the address, and there it was.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="city"\n        title=""\n        src="/static/city-43445152f39907fca2b28c03b8033600-631b1.jpg"\n        srcset="/static/city-43445152f39907fca2b28c03b8033600-30fbd.jpg 200w,\n/static/city-43445152f39907fca2b28c03b8033600-e87dc.jpg 400w,\n/static/city-43445152f39907fca2b28c03b8033600-631b1.jpg 800w,\n/static/city-43445152f39907fca2b28c03b8033600-300e3.jpg 1200w,\n/static/city-43445152f39907fca2b28c03b8033600-c15ef.jpg 1600w,\n/static/city-43445152f39907fca2b28c03b8033600-3a622.jpg 2400w,\n/static/city-43445152f39907fca2b28c03b8033600-646e8.jpg 4160w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<p>Almost every day I see an interesting event or meetup that I think would be fun to attend.  I don\'t go to most of them, but there\'s something intriguing about meeting up with a bunch of strangers brought together by a common interest.</p>\n<p>I talked to loads of people there, most notably some current students at <a href="http://www.hackreactor.com/?utm_source=googlesearchnetwork&#x26;utm_medium=text&#x26;utm_campaign=P_Search_BrandOnsite_General&#x26;utm_term=hack%20reactor&#x26;utm_content=HROS">Hack Reactor</a> and <a href="https://www.appacademy.io/">App Academy</a>, two of the most selective coding boot camps in San Francisco.</p>\n<p>I\'ve heard a lot of mixed opinions about coding bootcamps, so it was satisfying to be able to hear directly from people that have gone through the experience.</p>\n<p>I\'m super interested in alternative methods of education and the edtech industry.  It\'s absolutely an area that I think needs and will continue to grow in the coming years.</p>\n<p>The diversity amongst the bootcamp students that I met was also fascinating.</p>\n<p>There was a 19 year-old that had lived a semi-nomadic lifestyle after graduating high school.  He visited almost every state in the U.S, and paid for it mainly through street piano performances.</p>\n<p>At some point he figured out that he could hack together websites as freelance work to generate a little extra income on the side.  He ended up getting super into it, coming to San Francisco, and getting accepted to Hack Reactor.</p>\n<p>I met a guy in his mid 30s that had a PhD in neurobiology.  He told me he wanted to learn to code so that he could pursue his dream of working on Elon Musk\'s Neuralink.</p>\n<p>People of all types are learning to code for all kinds of reasons.</p>\n<p>If it\'s something you have an interest in, you don\'t have to drop everything and enroll in a bootcamp.  A few hours a week is a great place to start.  Every day is a great place to start.</p>\n<p>If you\'re not sure where to start, or you\'re feeling stuck in your journey, feel free to reach out to me (twm013@bucknell.edu).</p>\n<h2>Internapalooza</h2>\n<p>Wednesday night was internapalooza.</p>\n<p>For the most part, the event was a good reminder of the fact that networking events, especially those made up of ~8,000 interns are not actually a great place to "network".</p>\n<p>That being said, the event was still a good opportunity to chat with recruiters and engineers at top tech companies that don\'t come to recruit at Bucknell.</p>\n<p>I also enjoyed the anecdote shared by <a href="https://en.wikipedia.org/wiki/Drew_Houston">Drew Houston</a>, CEO of dropbox.</p>\n<p>When he was in college living in a Fraternity house, they had a constant problem of people leaving dirty dishes in the sink.  One day after a meal, him and his friend went to wash their dishes (like any well-behaved frat bro should).</p>\n<p>Without saying anything, his friend picked up a few dirty dishes, washed them, and continued on.</p>\n<p>"You don\'t have to wash those" he told his friend.  It wasn\'t fair that he should wash someone else\'s dishes because they had left them in the sink out of negligence.</p>\n<p>Later, he thought back on the moment and realized maybe he had been thinking about it wrong.  Since then, "washing the dishes" has become a guiding principal for various facets of his life.</p>\n<p>Sometimes the best way to solve a problem is to take a little extra time, and do it yourself.  </p>\n<p>In terms of work, I love this mantra.  If you see a reoccurring problem, you don\'t need to figure out who is responsible for it, or ask permission, you just need to care enough to solve it.  That in and of itself is valuable.</p>\n<p>The world could get a lot better if we all picked up a few extra dirty dishes.</p>\n<p>On Thursday, I did my first escape room as part of a Braintree intern event.</p>\n<p>It\'s pretty insane the experience that the owners of <a href="https://www.tryreason.com/">Reason</a> have been able to create.  I would definitely recommend checking if out if you\'re with a big group and appreciate puzzles and cool technologies.</p>\n<div class="row post-image-bg" markdown="0">\n    <video width="99%" height="540" autoplay loop muted markdown="0">\n        <source src="/reason_video-9d77598dfc457b28b6101a3f74c01515.mp4" type="video/mp4" markdown="0" >\n    </video>\n</div>\n<h4>Post Escape Room Victory Dance</h4>\n<p>We solved it, but admittedly about a minute or two over the 80 minute time limit.</p>\n<p>On Friday I grabbed dinner at <a href="http://spinnerie.com/">Spinnerie</a> with Jeff Meyerson, host of <a href="https://softwareengineeringdaily.com/">Software Engineering Daily</a>, my favorite podcast for keeping up with software and technology.</p>\n<p>It was a little awkward at first, but before I knew it we were engrossed in conversations about education, cryptocurrency, advertising, the future of podcasts, and so much more.</p>\n<p>It was pretty cool getting to meet the person who has produced literally hundreds of hours of content that helped me get the internship at Braintree and to where I am today.</p>\n<p>Thanks Jeff, for continuing to put out a plethora of great content.</p>\n<p>Pride parade was also on Sunday which was quite the experience.  I walked with PayPal/Braintree/Venmo and then walked to Dolores park with a few of my fellow interns (shoutout to Maggie and Sasha).</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="rainbow flags"\n        title=""\n        src="/static/rainbow-8e14cdc45fb110c6a34081584a57398e-631b1.jpg"\n        srcset="/static/rainbow-8e14cdc45fb110c6a34081584a57398e-30fbd.jpg 200w,\n/static/rainbow-8e14cdc45fb110c6a34081584a57398e-e87dc.jpg 400w,\n/static/rainbow-8e14cdc45fb110c6a34081584a57398e-631b1.jpg 800w,\n/static/rainbow-8e14cdc45fb110c6a34081584a57398e-300e3.jpg 1200w,\n/static/rainbow-8e14cdc45fb110c6a34081584a57398e-c15ef.jpg 1600w,\n/static/rainbow-8e14cdc45fb110c6a34081584a57398e-3a622.jpg 2400w,\n/static/rainbow-8e14cdc45fb110c6a34081584a57398e-c1f12.jpg 3120w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<p>We hit up bi-rite creamery again (which was equally amazing as the first time), and hung out at the park for a bit.</p>\n<p>The fact that a scene like Dolores park even exists is hard to believe until you see it for yourself.  I wish I had taken some pictures to document it.  We had no idea what we were walking into.  Hundreds (thousands?) of people were there partying the entire day.</p>\n<p>I don\'t think we quite got the "full" experience, but I will say that the people watching was pretty entertaining.</p>\n<h2>Work</h2>\n<p>Coming into work every day is still fun, which honestly is not something that I expected.</p>\n<p>Every day my pair and I share a fun fact with each other, and then get to work.  The only parts I haven\'t learned to enjoy are pieces of the manual deploy process, and Kafka integration testing...(don\'t ask, just trust me on this one).</p>\n<p>My Vim/Tmux skills are still well below where they need to be, but I have reached a basic level of proficiency.  At this point I\'m fully converted to the way Braintree does things.</p>\n<p>Vim is ridiculously powerful.  I swear every day my pair pulls out of new trick that I didn\'t know existed or saves 20 minutes of work with a single line of regex sorcery.  He\'s inspired me to work on my regex skills.  <a href="https://regexcrossword.com/">Regex Crossword</a> is his personal recommendation for getting to his level (one can dream).</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 99.53703703703702%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="interns"\n        title=""\n        src="/static/interns-57f9034e534dbbc2fd0d0ae9a7596527-631b1.jpg"\n        srcset="/static/interns-57f9034e534dbbc2fd0d0ae9a7596527-30fbd.jpg 200w,\n/static/interns-57f9034e534dbbc2fd0d0ae9a7596527-e87dc.jpg 400w,\n/static/interns-57f9034e534dbbc2fd0d0ae9a7596527-631b1.jpg 800w,\n/static/interns-57f9034e534dbbc2fd0d0ae9a7596527-f04a1.jpg 1080w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>The Intern Crew</h4>\n<p>Now that I am officially halfway through my internship, I have been working on taking more ownership of my work.  It\'s easier to let my pair take the lead on everything, but I know the only way to get closer to his level is to take the lead on certain tasks and get comfortable working independently at times.</p>\n<p>It\'s helpful to remember that most of the time my pair has just as little background knowledge in whatever problem we\'re working on as I do, he\'s just gotten really good at teaching himself how to quickly figure it out.</p>\n<p>In terms of development skills, I still lack a lot of general rails knowledge, but I have gotten a lot more comfortable working in Ruby, in part by spending a little extra time outside of work reading articles and watching some interesting conference talks.</p>\n<p>Here\'s a few of my favorites:</p>\n<ul>\n<li><a href="https://www.youtube.com/watch?v=piLmdh3Am3o">Lies, Damned Lies, and Substrings by Haseeb Qureshi</a></li>\n<li><a href="https://www.youtube.com/watch?v=piLmdh3Am3o">My Meta Moments by John Dewyze</a></li>\n<li><a href="https://www.youtube.com/watch?v=Q_MpGRfnY5s">Perusing the Rails Source Code - A Beginners Guide by Alex Kitchens</a></li>\n</ul>\n<p>I\'ve also been thinking a lot about company culture recently, something that first-time founders often completely overlook.  If you look at all of the top tech companies: Netflix, Google, Amazon, Facebook, etc..., they all have a unique but very intentional culture.</p>\n<p>Braintree is no different.</p>\n<p>It\'s hard to convey exactly what the culture is here, but there is definitely a lot of value placed on open communication feedback, and openness.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="cable car"\n        title=""\n        src="/static/cablecar-e5235a95b698fb734e875753949214ed-631b1.jpg"\n        srcset="/static/cablecar-e5235a95b698fb734e875753949214ed-30fbd.jpg 200w,\n/static/cablecar-e5235a95b698fb734e875753949214ed-e87dc.jpg 400w,\n/static/cablecar-e5235a95b698fb734e875753949214ed-631b1.jpg 800w,\n/static/cablecar-e5235a95b698fb734e875753949214ed-300e3.jpg 1200w,\n/static/cablecar-e5235a95b698fb734e875753949214ed-c15ef.jpg 1600w,\n/static/cablecar-e5235a95b698fb734e875753949214ed-3a622.jpg 2400w,\n/static/cablecar-e5235a95b698fb734e875753949214ed-646e8.jpg 4160w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<p>Braintree also hires a lot of developers that did not formally study computer science in college and were largely self taught to begin their career.  It\'s not uncommon to work with a philosophy or bio major (among others).  It makes for a really dynamic and fun mix of people.</p>\n<p>It\'s an important factor as I start to think about what I might like to work next year.</p>\n<hr>\n<p>Thanks for taking the time out of your day to give this a read, it really does mean a lot to me. Remember to check back in for a post on Wednesday to hear about Tahoe, Interview Prep and a 4th of July in San Francisco!</p>',frontmatter:{path:"/interning-in-sf-week-4",title:"Escape rooms, Internapalooza, Pride parade and so much more (Interning in San Francisco Week 4)",date:"2017-7-02",tag:"Life"}}},pathContext:{}}}});
